import React, { useState } from 'react';
import axios from 'axios';

function GetStarted() {
  const [formData, setFormData] = useState({
    name: '',
    age: '',
    occupation: '',
    interests: '',
    stress_level: 5,
    available_time: 15,
    preferred_break_types: ['physical', 'mental', 'social']
  });

  const [recommendation, setRecommendation] = useState(null);
  const [loading, setLoading] = useState(false);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData(prev => ({
      ...prev,
      [name]: value
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);

    try {
      const response = await axios.post('http://localhost:8000/api/recommend', {
        ...formData,
        interests: formData.interests.split(',').map(i => i.trim()),
        age: parseInt(formData.age),
        stress_level: parseInt(formData.stress_level),
        available_time: parseInt(formData.available_time)
      });

      setRecommendation(response.data);
    } catch (error) {
      console.error('Error getting recommendation:', error);
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="max-w-2xl mx-auto">
      <h1 className="text-4xl font-bold text-gray-900 mb-8">Get Your Break Recommendation</h1>

      {!recommendation ? (
        <form onSubmit={handleSubmit} className="space-y-6">
          <div>
            <label className="block text-sm font-medium text-gray-700">Name</label>
            <input
              type="text"
              name="name"
              value={formData.name}
              onChange={handleChange}
              className="mt-1 block w-full rounded-md border-gray-300 shadow-sm focus:border-indigo-500 focus:ring-indigo-500"
              required
            />
          </div>

          <div>
            <label className="block text-sm font-medium text-gray-700">Age</label>
            <input
              type="number"
              name="age"
              value={formData.age}
              onChange={handleChange}
              className="mt-1 block w-full rounded-md border-gray-300 shadow-sm focus:border-indigo-500 focus:ring-indigo-500"
              required
            />
          </div>

          <div>
            <label className="block text-sm font-medium text-gray-700">Occupation</label>
            <input
              type="text"
              name="occupation"
              value={formData.occupation}
              onChange={handleChange}
              className="mt-1 block w-full rounded-md border-gray-300 shadow-sm focus:border-indigo-500 focus:ring-indigo-500"
              required
            />
          </div>

          <div>
            <label className="block text-sm font-medium text-gray-700">Interests (comma-separated)</label>
            <input
              type="text"
              name="interests"
              value={formData.interests}
              onChange={handleChange}
              className="mt-1 block w-full rounded-md border-gray-300 shadow-sm focus:border-indigo-500 focus:ring-indigo-500"
              required
            />
          </div>

          <div>
            <label className="block text-sm font-medium text-gray-700">
              Stress Level (1-10)
            </label>
            <input
              type="range"
              name="stress_level"
              min="1"
              max="10"
              value={formData.stress_level}
              onChange={handleChange}
              className="mt-1 block w-full"
            />
            <div className="text-sm text-gray-500">{formData.stress_level}</div>
          </div>

          <div>
            <label className="block text-sm font-medium text-gray-700">
              Available Time (minutes)
            </label>
            <input
              type="number"
              name="available_time"
              value={formData.available_time}
              onChange={handleChange}
              className="mt-1 block w-full rounded-md border-gray-300 shadow-sm focus:border-indigo-500 focus:ring-indigo-500"
              required
            />
          </div>

          <button
            type="submit"
            disabled={loading}
            className="w-full bg-indigo-600 text-white py-2 px-4 rounded-md hover:bg-indigo-700 focus:outline-none focus:ring-2 focus:ring-indigo-500 focus:ring-offset-2"
          >
            {loading ? 'Getting Recommendation...' : 'Get Recommendation'}
          </button>
        </form>
      ) : (
        <div className="bg-white p-6 rounded-lg shadow-lg">
          <h2 className="text-2xl font-semibold text-gray-900 mb-4">Your Break Recommendation</h2>
          <div className="space-y-4">
            <div>
              <h3 className="text-lg font-medium text-gray-900">Activity</h3>
              <p className="text-gray-600">{recommendation.activity}</p>
            </div>
            <div>
              <h3 className="text-lg font-medium text-gray-900">Duration</h3>
              <p className="text-gray-600">{recommendation.duration} minutes</p>
            </div>
            <div>
              <h3 className="text-lg font-medium text-gray-900">Description</h3>
              <p className="text-gray-600">{recommendation.description}</p>
            </div>
            <div>
              <h3 className="text-lg font-medium text-gray-900">Benefits</h3>
              <ul className="list-disc list-inside text-gray-600">
                {recommendation.benefits.map((benefit, index) => (
                  <li key={index}>{benefit}</li>
                ))}
              </ul>
            </div>
          </div>
          <button
            onClick={() => setRecommendation(null)}
            className="mt-6 bg-indigo-600 text-white py-2 px-4 rounded-md hover:bg-indigo-700 focus:outline-none focus:ring-2 focus:ring-indigo-500 focus:ring-offset-2"
          >
            Get Another Recommendation
          </button>
        </div>
      )}
    </div>
  );
}

export default GetStarted;
